import React from "react";

const ModuleLogin = ({ children, open, isClose }) => {
  if (!open) {
    return null;
  }
  return (
    <div class="modal" id="becomeClientsModal">
      <div class="modal__inner">
        <div class="modal__content">{children}</div>
      </div>
    </div>
  );
};
export { ModuleLogin };
